import acctof from "../imagespexels-ivan-samkov-4989168.jpg"
import React from 'react';
import {
  MDBCarousel,
  MDBCarouselItem,
} from 'mdb-react-ui-kit';



const Home = () => {
    return (
       <div className="main">
        <div className="slide">
        <MDBCarousel showControls showIndicators dark fade>
                    <MDBCarouselItem
                        className='w-100 '
                        itemId={1}
                        src={acctof}
                        alt='...'
                    >
                        <h5>First slide label</h5>
                        <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                    </MDBCarouselItem>
                    <MDBCarouselItem
                        className='w-100 '
                        itemId={2}
                        src={acctof}
                        alt='...'
                    >
                        <h5>Second slide label</h5>
                        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                    </MDBCarouselItem>

                    <MDBCarouselItem
                        className='w-100 '
                        itemId={3}
                        src={acctof}
                        alt='...'
                    >
                        <h5>Third slide label</h5>
                        <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                    </MDBCarouselItem>
                </MDBCarousel>
        </div>
       </div>
    );
}

export default Home;
